#@title Removendo stopwords
stopwords_pt = set(stopwords.words('portuguese'))

def remove_stopwords(texto):
    # Access the current row's 'enunciado' value using 'texto'
    palavras = word_tokenize(texto.lower(), language='portuguese')
    palavras_filtradas = [
        palavra for palavra in palavras
        if palavra not in stopwords_pt and palavra not in string.punctuation
    ]

    return " ".join(palavras_filtradas)

# Aplica a função à coluna de texto
df["enunciado_sem_sw"] = df["enunciado"].apply(remove_stopwords)

