#@title Divisão dos enunciados em tópicos

lista_info = df['enunciado_sem_sw'].tolist()

topic_model = BERTopic(language="brazilian portuguese")
topics, probs = topic_model.fit_transform(lista_info)

topic_model.get_topic_info()

#@title Intertropic Distance Map
fig = topic_model.visualize_topics()
fig.show()

#@title Dendrograma tópicos
topic_model.visualize_hierarchy()

#@title Score de cada palavra no tópico
topic_model.visualize_barchart(top_n_topics=16)

df['topico'] = topics
df['topico'].unique()

#@title Arrumando "outliers"

limite_superior = df['NU_PARAM_B'].quantile(0.9)
limite_inferior = df['NU_PARAM_B'].quantile(0.004)

df_corrigido = df.copy()

df_corrigido.loc[df_corrigido['NU_PARAM_B'] > limite_superior, 'NU_PARAM_B'] /= 1000

df_corrigido.loc[df_corrigido['NU_PARAM_B'] < limite_inferior, 'NU_PARAM_B'] /= 1000

print(df_corrigido['NU_PARAM_B'].describe())

#@title Distribuição de dificuldade (Parâmetro B) por tópicos
opicos_unicos = df_corrigido['topico'].unique()
topicos_unicos = [str(topic) for topic in topicos_unicos]

fig = make_subplots(rows=1, cols=len(topicos_unicos), subplot_titles=topicos_unicos)

for i, topico in enumerate(topicos_unicos):
    subset = df_corrigido[df_corrigido['topico'] == int(topico)]

    fig.add_trace(
        go.Histogram(x=subset['NU_PARAM_B'], name=topico, nbinsx=20, opacity=0.75),
        row=1, col=i+1
    )

fig.update_layout(
    title="Distribuição das Dificuldades por Tópico",
    height=500, width=250 * len(topicos_unicos),
    showlegend=False,
    barmode="overlay"
)

fig.show()

